import React,{Fragment} from 'react';
import './App.css';
/*import Main1 from './Shopping/Main1';*/
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Main from './Netflix/Main';
import Freeapp from './Netflix/Freeapp';
import Signin from './Netflix/Signin';

function App() {
  return (
  <>
   <Main/>
  <BrowserRouter>
  <Fragment>

  <Routes>
		      <Route exact path="/signin" element={<Signin/>}/>
			  <Route exact path="/freeapp" element={<Freeapp/>}/>
  </Routes>
  </Fragment>
  </BrowserRouter>
  </>
  );
}

export default App;
